import './App.css';
import { useState } from 'react';

function App() {

  return (
    <div className="App">
      <div className='gr grade1'>
        <TableModal></TableModal>
      </div>
      <div className='grade2'>
        <TableModal></TableModal>
      </div>
      <div className='grade3'>
        <TableModal></TableModal>
      </div> 
    </div>
  );
}

function TableModal() {
  const [attScore, setAttScore] = useState('');
  const [assScore, setAssScore] = useState('');

  const onInputChange = (e) => {
    const {name, value} = e.target;

    if (name === 'attScore') {
      if (value < 0 || value >= 30) {
        alert('출석 점수는 0보다 크고 30보다 작아야 합니다.');
        setAttScore('');
      } else {
        setAttScore(value);
      }

    } else if (name === 'assScore') {
      if (value < 0 || value >= 30) {
        alert('과제 점수는 0보다 크고 30보다 작아야 합니다.');
        setAssScore('');
      } else {
        setAssScore(value);
      }
    }

  };

  return(
    <table width={1000} border={1}>
        <thead>
          <tr>
            <th>이수</th>
            <th>필수</th>
            <th>과목명</th>
            <th>학점</th>
            <th>출석점수</th>
            <th>과제점수</th>
            <th>중간고사</th>
            <th>기말고사</th>
            <th>총점</th>
            <th>평균</th>
            <th>성적</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>
              <select>
                <option>교양</option>
                <option>전공</option>
              </select>
            </td>
            <td>
              <select>
                <option>필수</option>
                <option>선택</option>
              </select>
            </td>
            <td>
              <input type='text' name='subName'/>
            </td>
            <td>
              <input type='text' name='credit' style={{width: 45 + 'px'}}/>
            </td>
            <td>
              <input type='text' name='attScore' value={attScore} onChange={onInputChange} style={{width: 45 + 'px'}}/>
            </td>
            <td>
              <input type='text' name='assScore' value={assScore} onChange={onInputChange}  style={{width: 45 + 'px'}}/>
            </td>
            <td>
              <input type='text' name='midterm' style={{width: 45 + 'px'}}/>
            </td>
            <td>
              <input type='text' name='final' style={{width: 45 + 'px'}}/>
            </td>
            <td>총점</td>
            <td>평균</td>
            <td>성적</td>
          </tr>
        </tbody>
      </table>
  );
}
export default App;
